import './nav.css';
import Nav from "./nav.js";
import Link from "../Link/link.jsx";


function Navigation() {
    
    let list2 = [];

    Nav.map((value, index) => {
        list2.push(<Link text={value.section} link={value.href} key={value.text} />);
        list2.push(<span key={index}>{value. separatuon}</span>);
    });

    list2.pop ();

     return(
        <div className="nav">       
            <div className="navRow" >
            {list2}
            </div>
        </div> 
     )
}
export default Navigation
